// ==UserScript==
// @name         百度去除不要内容
// @version      1.1
// @description  去除百度所有网站自己不要的内容
// @author       You
// @match        *://*.baidu.com/*
// @icon         data:image/png;base64,
// @grant        none

// ==/UserScript==

(function() {
    'use strict';

    setInterval(function() {
		//清除首页百度热搜
		if(document.querySelector("#s-hotsearch-wrapper")){
			document.querySelector("#s-hotsearch-wrapper > div.s-hotsearch-title").remove();
			document.querySelector("#s-hotsearch-wrapper > ul.s-hotsearch-content").remove();
		}
		//清除首页设置
		if(document.querySelector(".s-top-right-text.c-font-normal.c-color-t.s-top-right-new")){
			document.querySelector(".s-top-right-text.c-font-normal.c-color-t.s-top-right-new").remove();
		}
		//去除首页左侧上方链接
		if(document.querySelector(".mnav.c-font-normal.c-color-t")){
			if(document.querySelectorAll(".mnav.c-font-normal.c-color-t")[1].text == 'hao123'){
				let s_top_left = document.querySelectorAll(".mnav.c-font-normal.c-color-t")
				for(let i=0;i < s_top_left.length;i++){
					if(s_top_left[i].text == '新闻' || s_top_left[i].text == 'hao123' || s_top_left[i].text == '视频' || s_top_left[i].text == '网盘'){
						s_top_left[i].remove();
					}
				}
				if(document.querySelector("#s-top-left > div")){
					document.querySelector("#s-top-left > div").remove();
				}
				let a = document.createElement("a");
				a.href = 'http://fanyi.baidu.com/';
				a.target = '_blank';
				a.classList = 'mnav c-font-normal c-color-t';
				a.text = '翻译';
				document.querySelector("#s-top-left").append(a);
				Obtaining_the_carousel_map();
			}
		}
		//去除首页下方许可
		if(document.querySelector("#bottom_layer")){
			document.querySelector("#bottom_layer").remove();
		}
		
		
		//关闭地图登录界面
		if(document.querySelector("#TANGRAM__PSP_37__body")){
			document.querySelector("#TANGRAM__PSP_39__closeBtn").click();
		}
		//清除地图个人信息头像
		if(document.querySelector("#user-center")){
			document.querySelector("#user-center").remove();
		}
		//清除地图广告
		if(document.querySelector("#message-center")){
			document.querySelector("#message-center").remove();
		}
		//清除地图搜索框内立即登录
		if(document.querySelector("div.city-special-container > div.clear-history")){
			document.querySelector("div.city-special-container > div.clear-history").remove();
		}
		//清除地图扫码打开地图APP
		if(document.querySelector("#ui3-suggest-wrap > div.leadDownloadCard")){
			document.querySelector("#ui3-suggest-wrap > div.leadDownloadCard").remove();
		}
		//清除地图下方许可
		if(document.querySelector("#MapHolder > div.BMap_cpyCtrl.BMap_noprint.anchorBL")){
			document.querySelector("#MapHolder > div.BMap_cpyCtrl.BMap_noprint.anchorBL").remove();
		}
		
		
		//清除图片上方链接
		if(document.querySelector("div.wrapper_userinfo_box")){
			document.querySelector("div.wrapper_userinfo_box").remove();
		}
		//清除图片--背景图片来源
		if(document.querySelector("#wrapperImgFromBox")){
			document.querySelector("#wrapperImgFromBox").remove();
		}
		//清除图片下方许可
		if(document.querySelector("div.bd-home-footer")){
			document.querySelector("div.bd-home-footer").remove();
		}
		//清除图片上方链接
		if(document.querySelector("div.bd-albumsdetail-header")){
			document.querySelector("div.bd-albumsdetail-header").remove();
		}
		//清除图片图库
		if(document.querySelector("div.albumsdetail-logo")){
			document.querySelector("div.albumsdetail-logo").remove();
		}
		//清除图片商品推荐
		if(document.querySelector("#siderCardsAfterWikiInfo")){
			document.querySelector("#siderCardsAfterWikiInfo").remove();
			Obtaining_the_carousel_map();
		}
		//清除图片反馈
		if(document.querySelector("#report_link")){
			document.querySelector("#report_link").remove();
		}
		//登录
		if(document.querySelector("#userInfo")){
			document.querySelector("#userInfo").remove();
		}
		//清除相关搜索
		if(document.querySelector("li.rsItem.imgitem")){
			let imgitem = document.querySelectorAll("li.rsItem.imgitem")
			for(let i=0;i < imgitem.length;i++){
				imgitem[i].remove();
			}
		}
		//清除图片反馈
		if(document.querySelector("#common-feedback-link")){
			document.querySelector("#common-feedback-link").remove();
		}
		
		
		//清除翻译许可
		if(document.querySelector("div.footer.cleafix")){
			document.querySelector("div.footer.cleafix").remove();
		}
		//清除翻译上方链接
		if(document.querySelector("div.container > div#header")){
			document.querySelector("#header").remove();
		}
		//清除翻译设置
		if(document.querySelector("div.translate-setting")){
			document.querySelector("div.translate-setting").remove();
		}
		//清除翻译广告
		if(document.querySelector("div.domain-trans-wrapper")){
			document.querySelector("div.domain-trans-wrapper").remove();
		}
		//清除翻译广告
		if(document.querySelector("#transOtherRight")){
			document.querySelector("#transOtherRight").remove();
			Obtaining_the_carousel_map();
		}
		
		
		//清除百度搜索右侧广告与热搜
		if(document.querySelector("#content_right")){
			document.querySelector("#content_right").remove();
			Obtaining_the_carousel_map();
		}
		if(document.querySelector("div._2z1q32z")){
			let container = document.querySelectorAll("div._2z1q32z");
			for(let i=0;i < container.length;i++){
				container[i].parentNode.remove();
			}
		}
		if(document.querySelector("#\\31 ")){
			let container = document.querySelectorAll("#\\31 ");
			for(let i=0;i < container.length;i++){
				container[i].remove();
			}
		}
	},1000);
	//获取轮播图
	function Obtaining_the_carousel_map(){
		var myHeaders = new Headers();
		myHeaders.append("User-Agent", "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/105.0.0.0 Safari/537.36 Edg/105.0.1343.50");
		myHeaders.append("Accept", "*/*");
		myHeaders.append("Host", "heniunaidebaobao.github.io");
		myHeaders.append("Connection", "keep-alive");

		var requestOptions = {
		   method: 'GET',
		   headers: myHeaders,
		   redirect: 'follow'
		};

		fetch("https://heniunaidebaobao.github.io/Oil_monkey_plug-in_library/Carousel_map_link.json", requestOptions)
		   .then(response => response.json())
		   .then(json => Carousel_chart(json))
		   .catch(error => console.log('error', error));
	}
	
	//轮播图
	function Carousel_chart(json){
		if (!document.querySelector("div#niunai_Carousel_chart")){
			let temp;
			if(document.querySelector("#s-hotsearch-wrapper")){
				temp = document.querySelector("#s-hotsearch-wrapper");
			}else if(document.querySelector("#sider > div")){
				temp = document.querySelector("#sider > div")
			}else if(document.querySelector("div.trans-other-wrap.clearfix")){
				temp = document.querySelector("div.trans-other-wrap.clearfix")
			}else if(document.querySelector("div#container")){
				temp = document.querySelector("div#container")
			}
			let div = document.createElement("div");
			div.id = 'niunai_Carousel_chart';
			div.style = 'display: flex;justify-content: center;align-items: center;';
			if(temp == document.querySelector("div#container")){
				temp.insertBefore(div,document.querySelector("#content_left").nextSibling);
			}else{
				temp.append(div);
			}
			let img = document.createElement("img");
			img.src = json.Carousel_map_link[0];
			div.append(img);
			let num = 0;
			setInterval(function() {
				num++;
				if(num == json.Carousel_map_link.length){
					num = 0;
				}
				img.src = json.Carousel_map_link[num];
			},2000);
		}
	}
})();